import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import { handleError, handleSuccess } from '../utils';
import signupBg from '../assets/signup-bg.png';

function Login() {
    const [loginInfo, setLoginInfo] = useState({
        email: '',
        otp: ''
    });
    const [showOtp, setShowOtp] = useState(false);
    const [keepLoggedIn, setKeepLoggedIn] = useState(false);

    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setLoginInfo(prev => ({ ...prev, [name]: value }));
    };

    const handleLogin = async (e) => {
        e.preventDefault();
        const { email, otp } = loginInfo;

        if (!email || !otp) {
            return handleError('Email and OTP are required');
        }

        try {
            const response = await fetch('http://localhost:4000/auth/login', {
                method: "POST",
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify(loginInfo)
            });

            const result = await response.json();
            if (result.success) {
                handleSuccess(result.message || 'Login successful');
                localStorage.setItem('token', result.jwtToken);
                localStorage.setItem('loggedInUser', result.name);
                if (keepLoggedIn) localStorage.setItem('keepLoggedIn', 'true');
                setTimeout(() => navigate('/home'), 1000);
            } else {
                handleError(result?.error?.details?.[0]?.message || result.message || 'Login failed');
            }
        } catch (err) {
            handleError('Network error or server is unreachable');
            console.error(err);
        }
    };

    return (
        <div className="w-[825px] h-[1000px] rounded-[24px] p-8 flex gap-8 bg-white shadow-lg overflow-hidden mx-auto">
            <div className="w-1/2 flex flex-col justify-center space-y-6">
                <div className="text-xl font-bold">üåê HD</div>
                <h2 className="text-3xl font-semibold">Sign In</h2>
                <p className="text-sm text-gray-500">Please login to continue to your account.</p>

                <form onSubmit={handleLogin} className="flex flex-col space-y-4">
                    <input
                        type="email"
                        name="email"
                        placeholder="Email"
                        value={loginInfo.email}
                        onChange={handleChange}
                        className="h-[52px] px-4 rounded-xl border-[1.5px] border-gray-300 text-sm outline-none"
                    />
                    <div className="relative">
                        <input
                            type={showOtp ? "text" : "password"}
                            name="otp"
                            placeholder="OTP"
                            value={loginInfo.otp}
                            onChange={handleChange}
                            className="h-[52px] px-4 w-full rounded-xl border-[1.5px] border-gray-300 text-sm outline-none"
                        />
                        <span
                            onClick={() => setShowOtp(prev => !prev)}
                            className="absolute right-4 top-1/2 -translate-y-1/2 text-gray-500 cursor-pointer"
                        >
                            {showOtp ? "üôà" : "üëÅÔ∏è"}
                        </span>
                    </div>

                    <span className="text-sm text-violet-600 cursor-pointer w-fit">Resend OTP</span>

                    <label className="flex items-center gap-2 text-sm">
                        <input
                            type="checkbox"
                            checked={keepLoggedIn}
                            onChange={(e) => setKeepLoggedIn(e.target.checked)}
                        />
                        Keep me logged in
                    </label>

                    <button
                        type="submit"
                        className="bg-violet-600 hover:bg-violet-700 text-white font-semibold py-3 rounded-xl transition"
                    >
                        Sign In
                    </button>

                    <p className="text-sm text-center">
                        Need an account??{' '}
                        <Link to="/signup" className="text-violet-600 underline">
                            Create one
                        </Link>
                    </p>
                </form>
            </div>

            <div className="w-1/2 rounded-[24px] overflow-hidden">
                <img
                    src={signupBg}
                    alt="Login Background"
                    className="w-full h-full object-cover"
                />
            </div>

            <ToastContainer position="top-center" autoClose={3000} />
        </div>
    );
}

export default Login;
